import React, { Component } from "react";
import TextField from 'material-ui/TextField';
import RaisedButton from 'material-ui/RaisedButton';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import AppBar from 'material-ui/AppBar';
import "./App.css"
class App extends Component {
  stste={
    email :"",
    pass:""
  }



  render () {return (
    <div style={{  border: '2px solid ' ,marginTop:100, width:500,height:400,marginLeft:500}} >

        <MuiThemeProvider>

        <br/> <br/>

           <TextField  style={{  border: '2px' ,marginTop:10, marginLeft:50}} 
             hintText="User Name"
             onChange = {(event,newValue) => this.setState({username:newValue})}
             />
   <br/> <br/>
             <TextField
               type="password"
               hintText=" password"
               onChange = {(event,newValue) => this.setState({pass:newValue})}
               />
             <br/><br/>  <br/> <br/>  <br/> <br/>

             <RaisedButton label="Login"   onClick={(event) => this.handleClick(event)}/>



             </MuiThemeProvider>

    </div>
  );
}
}
export default App;
